window.bookSummaryJSON = "<p><b>SAMKIEL AND DIANNA RETURN</b><br> <br> 'A wicked ride from beginning to heart shattering end. Leaving me literally screaming for more. I couldn't turn the pages fast enough to get more our morally corrupt heroine who you can't help but root for, along with the giggle inducing banter between her and the heroic god Samkiel' <b>HANNAH NICOLE MAERHER</b><br> _________________________<br> <br> <b>WHERE THERE ARE GODS, THERE ARE ALSO MONSTERS . . .</b><br> <br> <i>Ask her what she ripped from the very heavens.</i><br> <i>And then ask her if she cares.</i><br> <br> Betrayed and bloodied, The Hand has failed. After a desperate battle, Nismera, the Goddess of War, now rules the realms as the last remnants of Samkiel's power spill across the sky.<br> <br> Desperate to keep Samkiel safe after almost losing him, Dianna is willing to give up everything to protect him, even if that means sacrificing their relationship itself. But that's not a risk Samkiel is willing to take, even as the stakes grow ever higher.<br> <br> The one true king is poised to return, but when the dust settles, who will truly rule?<br> <br> <i>Don't miss the first two books in this series, </i><b>THE BOOK OF AZRAEL</b><i> and </i><b>THE THRONE OF BROKEN GODS</b><i>!</i><br> _________________________<br> <br> 'Amber's series breaks the rules in the best way. Her main character is strong, capable, and unapologetically powerful. There is no damsel here. This story is filled with fast-paced action, an in-depth world, and a romance that goes from simmer to boil. If you like romantasy, read this!' <b>RAVEN KENNEDY</b><br> <br> 'Once in a while I read a series that reminds me of just why I love enemies to lovers, slow burn, and morally grey characters so much. Gods and Monsters is that series. This is perfection. Amber Nicole's Dianna is the FMC of my soul' <b>NISHA J. TULI<br> <br> </b></p>"; 
